import React from 'react';
import { Crown, Flame, TrendingUp } from "lucide-react";
import { TrophyIcon, StarIcon, TargetIcon, UsersIcon } from "./Iconcomponents";

// Data for the gamification elements, kept separate for clarity
const achievements = [
  { id: 1, title: "Cyber Champion üèÜ", description: "Won 5 competitions", icon: TrophyIcon, neonColor: "neon-blue", earned: true },
  { id: 2, title: "Network Architect ü§ù", description: "Connected with 100+ professionals", icon: UsersIcon, neonColor: "neon-purple", earned: true },
  { id: 3, title: "Skill Hacker üìö", description: "Completed 10 courses", icon: StarIcon, neonColor: "neon-cyan", earned: false },
  { id: 4, title: "Community Guardian ‚ù§Ô∏è", description: "Volunteered 50+ hours", icon: TargetIcon, neonColor: "neon-pink", earned: true }
];

const leaderboard = [
  { rank: 1, name: "Sarah Chen", avatar: "https://github.com/shadcn.png", points: 2840, badge: "ü•á", streak: 45 },
  { rank: 2, name: "Alex Rodriguez", avatar: "https://github.com/shadcn.png", points: 2650, badge: "ü•à", streak: 32 },
  { rank: 3, name: "Emma Johnson", avatar: "https://github.com/shadcn.png", points: 2420, badge: "ü•â", streak: 28 },
  { rank: 4, name: "You", avatar: "https://github.com/shadcn.png", points: 1890, badge: "", streak: 12, isCurrentUser: true }
];

// Main component function
export function GamificationSection() {
  return (
    <section className="py-20 bg-black relative overflow-hidden">
      <div className="absolute inset-0 cyber-grid opacity-15"></div>
      <div className="container mx-auto px-4 relative z-10">
        <div className="text-center mb-16">
          <h2 className="font-orbitron text-4xl md:text-5xl font-bold mb-6 text-white neon-text">
            Track Your Digital Progress
          </h2>
          <p className="text-xl text-white/80 max-w-3xl mx-auto leading-relaxed">
            Earn neon achievements, build cyber streaks, and compete with peers while advancing your digital career journey! ‚ö°
          </p>
        </div>

        <div className="grid lg:grid-cols-2 gap-8">
          {/* Achievements Section */}
          <div className="hologram p-6 rounded-2xl">
            <h3 className="font-orbitron text-2xl font-bold text-white mb-6 text-center">Your Achievements</h3>
            <div className="space-y-4">
              {achievements.map((achievement) => {
                const Icon = achievement.icon;
                return (
                  <div key={achievement.id} className={`flex items-center space-x-4 p-4 rounded-xl transition-all duration-300 ${achievement.earned ? `bg-black/30 border border-${achievement.neonColor}/30 shadow-${achievement.neonColor}` : 'bg-gray-800/50 opacity-60'}`}>
                    <div className={`p-3 rounded-xl bg-gradient-to-r from-${achievement.neonColor} to-${achievement.neonColor}/80 shadow-lg ${!achievement.earned && 'grayscale'}`}>
                      <Icon className="h-6 w-6" />
                    </div>
                    <div>
                      <div className="font-bold text-base text-white">{achievement.title}</div>
                      <div className="text-sm text-white/80">{achievement.description}</div>
                    </div>
                  </div>
                );
              })}
            </div>
          </div>

          {/* Leaderboard Section */}
          <div className="hologram p-6 rounded-2xl">
            <h3 className="font-orbitron text-2xl font-bold text-white mb-6 text-center">Weekly Leaderboard</h3>
            <div className="space-y-3">
              {leaderboard.map((user) => (
                <div key={user.rank} className={`flex items-center space-x-3 p-3 rounded-lg transition-all ${user.isCurrentUser ? 'bg-neon-blue/20 border border-neon-blue/30' : 'hover:bg-white/5'}`}>
                  <div className="text-lg font-bold text-neon-cyan w-8">{user.badge || `#${user.rank}`}</div>
                  <img src={user.avatar} alt={user.name} className="w-10 h-10 rounded-full border-2 border-neon-cyan/50" />
                  <div className="flex-1">
                    <div className={`font-medium text-sm ${user.isCurrentUser ? 'text-neon-blue' : 'text-white'}`}>{user.name}</div>
                    <div className="text-xs text-white/70 flex items-center space-x-2">
                      <span>{user.points} XP</span>
                      <span>‚Ä¢</span>
                      <span className="flex items-center space-x-1">
                        <Flame className="h-3 w-3 text-neon-pink" />
                        <span>{user.streak}</span>
                      </span>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}
